import "./IncExpView.css";

const IncExpView = ({ inc, setinc }) => {
  return (
    <div className="inc-exp">
      <div className="inc-container">
        <h2>Income</h2>
        <br />

        <h2 className="inc">
          £
          {inc.reduce(
            (totalinc, total) => (totalinc = totalinc + total.amount),
            0
          )}
        </h2>
      </div>

      <div className="exp-container">
        <h2>Expenses</h2>
        <br />
        <h2 className="exp">-£0.00</h2>
      </div>
    </div>
  );
};
export default IncExpView;
